** 酷照片 全球流行 ** 
-> 在全球 155 个iTunes商店给推荐! 
-> 在中国娱乐应用排名Top 24 (6月24日)! 

酷大头贴,配备人脸识别技术,拍出风趣的照片。4种流行的滤镜和8种酷炫的贴纸任你挑选。摆个Pose,说声“茄子”,酷大头贴给你留下欢乐。

--- 基本功能 ---
• 贴纸样式 – 2x2或4x1的贴纸自由选择;
• 摄像头 – 随意切换前后摄像头;
• 地理位置 – 在大头贴里记录你拍摄的位置;
• 摆Pose – 3秒钟倒计时让你摆出酷的造型。

--- 专业效果 ---
• 4个滤镜 – 配备了4个流行的滤镜:正常、甜蜜时光、黑白、光晕;
• 8种贴纸 – 酷大头贴带给你8个精彩的酷炫贴纸,包括:想入非非、两眼发晕、小鸟转圈、蜜蜂蛰鼻子、嘴里叼烟、头顶冒火、疯狂的锤子和牛气冲天。它们都经过精心设计并且富有乐趣;
• 脸部跟踪 – 多亏了人脸识别技术,动画效果看起来更加有趣;
• 应用内购买 – 想入非非、嘴里叼烟、小鸟转圈和甜蜜时光是可选的,可以付费购买。

--- 其它出色的功能和效果 ---
• 酷大头贴是一个Universal App(通用程序),为iPhone和iPad做了专业的设计和优化;
• 完美支持iPad和iPhone视网膜;
• 高清图片导出;
• 方便的照片打印;
• 可在设置里打开或关闭地理位置服务和声音效果;
• 放大欣赏大头贴,你将会喜欢上它。

感谢您的支持!

